import{_ as i,c as a,ag as e,o as t}from"./chunks/framework.BxW8Wou5.js";const u=JSON.parse('{"title":"1.HTTP状态码","description":"","frontmatter":{},"headers":[],"relativePath":"interview/网络/1. HTTP状态码.md","filePath":"interview/网络/1. HTTP状态码.md","lastUpdated":1705937785000}'),r={name:"interview/网络/1. HTTP状态码.md"};function o(n,l,_,h,s,d){return t(),a("div",null,l[0]||(l[0]=[e('<h1 id="_1-http状态码" tabindex="-1">1.HTTP状态码 <a class="header-anchor" href="#_1-http状态码" aria-label="Permalink to &quot;1.HTTP状态码&quot;">​</a></h1><h2 id="_1xx-信息-服务器收到响应-要求请求者继续操作" tabindex="-1">1XX（信息，服务器收到响应，要求请求者继续操作） <a class="header-anchor" href="#_1xx-信息-服务器收到响应-要求请求者继续操作" aria-label="Permalink to &quot;1XX（信息，服务器收到响应，要求请求者继续操作）&quot;">​</a></h2><ul><li>100（继续）：请求者应当继续提出请求。服务器返回此代码表示已收到请求的第一部分，正在等待其余部分</li><li>101（切换协议）：请求者已要求服务器切换协议，服务器已确认并准备切换</li></ul><h2 id="_2xx-成功-操作被成功接收并处理" tabindex="-1">2XX（成功，操作被成功接收并处理） <a class="header-anchor" href="#_2xx-成功-操作被成功接收并处理" aria-label="Permalink to &quot;2XX（成功，操作被成功接收并处理）&quot;">​</a></h2><ul><li>200（成功）：服务器已成功处理了请求</li><li>201（已创建）：请求成功并且服务器创建了新的资源</li><li>202（已接受）：服务器已接受请求，但还未处理</li><li>203（非授权信息）：服务器已成功处理了请求，但返回的信息可能来自另一来源</li><li>204（无内容）：服务器成功处理了请求，但没有返回任何内容</li><li>205（重置内容）：服务器成功处理了请求，但没有返回任何内容。</li><li>206（部分内容）：服务器成功处理了部分GET请求</li></ul><h2 id="_3xx-重定向-需要进一步操作完成请求" tabindex="-1">3XX（重定向，需要进一步操作完成请求） <a class="header-anchor" href="#_3xx-重定向-需要进一步操作完成请求" aria-label="Permalink to &quot;3XX（重定向，需要进一步操作完成请求）&quot;">​</a></h2><ul><li>300（多种选择）</li><li>301（永久移动）： 请求的网页已永久移动到新位置。 服务器返回此响应(对 GET 或 HEAD 请求的响应)时，会自动将请求者转到新位置。</li><li>302（临时移动）：与301类似，但资源只是被临时移动，继续请求旧URL。</li><li>303（查看其他位置）：</li><li>304（未修改）：所请求资源未被修改，服务器返回此状态码时，不会返回任何资源。客户端通常会<strong>缓存</strong>访问过的资源，通过提供一个头信息指出客户端希望只返回在指定日期之后修改的资源。</li><li>305（使用代理）：所请求的资源必须通过代理访问</li><li>307（临时重定向）：与302类似，使用GET请求重定向</li></ul><h2 id="_4xx-客户端错误-请求包含语法错误或无法完成请求-常见" tabindex="-1">4XX（客户端错误，请求包含语法错误或无法完成请求）- 常见 <a class="header-anchor" href="#_4xx-客户端错误-请求包含语法错误或无法完成请求-常见" aria-label="Permalink to &quot;4XX（客户端错误，请求包含语法错误或无法完成请求）- 常见&quot;">​</a></h2><ul><li>400（错误）：服务器不理解请求的语法</li><li>401（未授权）：要求身份验证</li><li>403（禁止）：服务器拒绝请求</li><li>404（未找到）：服务器找不到请求的网页</li></ul><h2 id="_5xx-服务端错误-服务器在处理请求中发生了错误" tabindex="-1">5XX（服务端错误，服务器在处理请求中发生了错误） <a class="header-anchor" href="#_5xx-服务端错误-服务器在处理请求中发生了错误" aria-label="Permalink to &quot;5XX（服务端错误，服务器在处理请求中发生了错误）&quot;">​</a></h2><ul><li>500（内部服务器错误）：服务器遇到未知错误，无法完成请求</li><li>501（未实现）：服务器不支持客户端请求的功能</li><li>502（网关错误）：网关或代理服务器接收到远端服务器的无效响应</li><li>503（服务器无法获得）：服务器已超载或维护中导致请求无法完成</li><li>504（网关超时）：网关或代理服务器等待时间超长</li><li>505（HTTP版本不支持）：服务器不支持请求标明的HTTP版本</li></ul>',11)]))}const T=i(r,[["render",o]]);export{u as __pageData,T as default};
